import { runInPromisePool } from "@defillama/sdk/build/generalUtil";
import { fetchHistoricalFromDB } from "../storeToDb";
import { getR2JSONString } from "../../src/utils/r2";
import { getChainIdFromDisplayName } from "../../src/utils/normalizeChain";
import { coins } from "@defillama/sdk";

const items: string[] = ["optimism"]; //, 'OP Mainnet', 'Optimism']
const concurrency: number = 1;
const allNewData: { [timestamp: string]: any } = {};

async function main() {
  const tokenMapping = await getR2JSONString("chainAssetsSymbolMap");

  await runInPromisePool({
    items,
    concurrency,
    processor: processChainKey,
  });

  async function processChainKey(slug: string) {
    const chainId = getChainIdFromDisplayName(slug);
    const allOldData = await fetchHistoricalFromDB(slug);
    const priceQueries: string[] = [];

    const invertedTokenMapping: { [symbol: string]: string } = {};
    Object.keys(tokenMapping).forEach((chain: string) => {
      const thisChainId = getChainIdFromDisplayName(chain);
      if (thisChainId != chainId) return;
      Object.keys(tokenMapping[chain]).forEach((symbol: string) => {
        invertedTokenMapping[symbol] = tokenMapping[chain][symbol];
      });
    });

    await runInPromisePool({
      items: allOldData,
      concurrency: 1,
      processor: processChainData,
    });

    // raw data like { <CHAINSLUG>: {canonical: { breakdown: { <RAW>: number }, total: number }}}
    async function processChainData({ timestamp, data }: any) {
      Object.keys(data).map((section: string) => {
        Object.keys(data[section].breakdown).forEach((symbol: string) => {
          const address = invertedTokenMapping[symbol];
          if (address && !priceQueries.includes(address)) priceQueries.push(address);
        });
      });

      const prices = await coins.getPrices(priceQueries, timestamp);

      Object.keys(data).map((section: string) => {
        if (!(timestamp in allNewData)) allNewData[timestamp] = {};
        allNewData[timestamp][chainId] = {};
        const sectionData = data[section];
        allNewData[timestamp][chainId][section] = { total: sectionData.total };

        Object.keys(sectionData.breakdown).forEach((symbol: string) => {
          const address = tokenMapping[symbol];
          if (!address) {
            console.error(`No address found for ${symbol} on chain ${slug} section ${section} w/ ${(sectionData.breakdown[symbol] / 1e6).toFixed(2)}M TVL`);
            return;
          }

          if (!prices[address]) {
            console.error(`No prices for ${address} on chain ${slug} section ${section}`);
            return;
          }

          const { price, decimals } = prices[address];

          const amount = sectionData.breakdown[symbol];
          const rawAmount = (amount * 10 ** decimals) / price;
          allNewData[timestamp][chainId][section].breakdown[address] = rawAmount;
        });
      });
    }
  }

  //   await storeHistoricalToDB({ timestamp: getCurrentUnixTimestamp(), value: rawData });
  return;
}

main(); // ts-node defi/l2/cli/migrateDataToV2.ts

